import React, { useEffect, useState } from 'react';
import { Alert, Dimensions, ImageBackground, StyleSheet, Text, View } from 'react-native';
import { TextInput } from 'react-native-gesture-handler';
import { TouchableHighlight } from 'react-native-gesture-handler';


function Createproduct({ navigation }) {
    const image = { uri: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ1IkQzbSnTYBHSp14vLm8IK-EmeCXO9RyHMA&usqp=CAU' };
    const [name, setname] = useState("");
    const [price, setprice] = useState("");
    const [quantity, setquantity] = useState(""); 

    const createproduct = async () => {
        if (name.length < 1 || identification.length < 1 || lastname.length < 1 || birthdate.length < 1 || city.length < 1 || neighborhood.length < 1 || phone.length < 1) {
            Alert.alert("No debe haber ningun campo vacio ")

      
        }
        else {
            const res = await fetch('http://192.168.1.17:4000/Productos',
                {
                    method: "POST",
                    headers: {
                        Accept: "application/json",
                        "Content-Type": "application/json"
                    },
                    body: JSON.stringify({
                        name: name,
                        price: price,
                        quantity: quantity        
                    })
                });
            await res.json();
            Alert.alert("Producto creado con exito ")
            navigation.goBack()
        }
    }
    return (
        <View style={styles.container}>
            <ImageBackground source={image} style={styles.image}>                
                <TextInput style={styles.textInput} onChangeText={text => setname(text)} placeholder="Name"></TextInput>
                <TextInput style={styles.textInput} onChangeText={text => setprice(text)} placeholder="Price"></TextInput>
                <TextInput style={styles.textInput} onChangeText={text => setquantity(text)} placeholder="Quantity"></TextInput>
               
                <TouchableHighlight style={styles.styleButton} onPress={createproduct} >
                    <Text style={styles.textCreateButton}>Agregar Cita</Text>
                </TouchableHighlight>
            </ImageBackground>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        flexDirection: 'column',
        alignItems: 'center'
    },
    textInput: {
        marginTop: 5,
        padding: 15,
        borderColor: 'black',
        borderRadius: 5,
        borderWidth: 1,
        width: Dimensions.get('screen').width * 0.9,
        backgroundColor: "white"
    },
    styleButton: {
        backgroundColor: '#6336C2',
        padding: 15,
        width: Dimensions.get('screen').width * 0.9,
        alignItems: 'center',
        borderRadius: 80,
        marginTop: 20
    },
    textCreateButton: {
        color: 'white'
    },
    image: {
        flex: 1,
        resizeMode: 'cover',
        justifyContent: 'center',
        width: Dimensions.get('screen').width * 1,
        alignItems: 'center',

    },

});

export default Createproduct;
